import React, { useEffect } from "react";
import API from "../ultis/API";
const FindNote = () => {
  let searchItem = async () => {
    try {
      let resp = await API.get(`notes/?search=Some`);
      console.log(resp); // eslint-disable-next-line
    } catch (error) {
      console.log(error);
    }
  };

  let handleSearchInputChange = (e) => {
    e.preventDefault();
    console.log(e.target.value);
  };
  useEffect(() => {
    searchItem();
  }, []);
  return (
    <input
      type="text"
      placeholder="Search"
      onChange={handleSearchInputChange}
    />
  );
};

export default FindNote;
